import "./Catalog.css";
export const Catalog = () => {
  return (
    <>
      <section className="catalog">
        <div className="container">
          <div className="services__logo">
            <img src={servicesLogo} alt="" />
            <h2 className="services__text">Детска парикмахерская</h2>
          </div>
        </div>
      </section>
    </>
  );
};
